import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for a product card to be visible (ensures JS has loaded featured products)
    await page.waitForSelector('div.product-card', { timeout: 5000 });

    // Click the first product card to open the modal
    await page.locator('div.product-card').first().click();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_clicked.png'));

    // Wait for the modal to be visible
    // The JavaScript sets the style to "display: block"
    const modalSelector = '.modal[style*="display: block"]';
    await page.waitForSelector(modalSelector, { timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_modal_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_modal_visible.png'));

    // Extract the title from the modal to verify it opened
    const productTitle = await page.locator('.product-detail-title').textContent();

    return {
      success: true,
      action: "Opened the product detail modal for the first featured product.",
      extractedData: {
        productTitleInModal: productTitle.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to open product detail modal",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
